import React from "react";
import { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap-icons/font/bootstrap-icons.css";
import { Outlet, Link, useNavigate } from "react-router-dom";

const Navbar = () => {
  const [placeholderIndex, setPlaceholderIndex] = useState(0);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const username = localStorage.getItem("name");
    setIsLoggedIn(!!username); // If token exists, set true, else false
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("name"); // Remove token
    setIsLoggedIn(false);
    navigate("/login"); // Redirect to login page
  };
  const placeholders = [
    "Search for 'Facial'",
    "Search for 'Kitchen Cleaning'",
    "Search for 'Home Spa'",
    "Search for 'Plumbing'",
    "Search for 'AC Repair'"
  ];

  useEffect(() => {
    const userToken = localStorage.getItem("token"); // Check login
    if (!userToken) {
      navigate("/login"); // Redirect to login if not logged in
    }

    const interval = setInterval(() => {
      setPlaceholderIndex((prevIndex) => (prevIndex + 1) % placeholders.length);
    }, 2000); // Change every 2 seconds

    return () => clearInterval(interval);
  }, []);

  return (
    <>
      <nav
        className="navbar navbar-expand-lg"
        style={{
          background: "linear-gradient(to right, #F8F9FA, #E3E7EB)",
          boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
          padding: "12px 25px",
        }}
      >
        <div className="container-fluid">
          {/* Brand Logo */}
          <a className="navbar-brand fw-bold" href="#">
            <img
              src="https://res.cloudinary.com/urbanclap/image/upload/t_high_res_category/w_108,dpr_2,fl_progressive:steep,q_auto:low,f_auto,c_limit/images/growth/home-screen/1687285683825-e6cf23.jpeg"
              alt="Logo"
              height="40"
              style={{ borderRadius: "8px" }}
            />
          </a>

          {/* Toggle Button for Mobile */}
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          {/* Navbar Links */}
          <div className="collapse navbar-collapse justify-content-center" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item px-3">
                <Link
                  to="/frontblog"
                  className="nav-link fw-bold"
                  style={{ color: "#2C3E50", transition: "0.3s" }}
                  onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
                  onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
                >
                  Blogs
                </Link>
              </li>
              <li className="nav-item px-3">
                <Link
                  to="/"
                  className="nav-link fw-bold"
                  style={{ color: "#2C3E50", transition: "0.3s" }}
                  onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
                  onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
                >
                  Category
                </Link>
              </li>

              {/* Location Selector */}
              <li className="nav-item dropdown px-3">
                <a
                  className="nav-link dropdown-toggle fw-bold"
                  href="#"
                  id="locationDropdown"
                  role="button"
                  data-bs-toggle="dropdown"
                  style={{ color: "#2C3E50" }}
                >
                  <i className="bi bi-geo-alt"></i> Chandigarh, India
                </a>
                <ul className="dropdown-menu">
                  <li>
                    <a className="dropdown-item" href="#">Delhi</a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#">Mumbai</a>
                  </li>
                  <li>
                    <a className="dropdown-item" href="#">Bangalore</a>
                  </li>
                </ul>
              </li>

             {/* Search Bar */}
             <li className="nav-item px-3">
                <form className="d-flex">
                  <input
                    className="form-control me-2"
                    type="search"
                    placeholder={placeholders[placeholderIndex]} // Dynamic Placeholder
                    style={{
                      borderRadius: "20px",
                      padding: "8px 15px",
                      border: "1px solid #B0BEC5",
                      outline: "none",
                      minWidth: "200px",
                    }}
                  />
                  <button
                    className="btn btn-secondary"
                    type="submit"
                    style={{
                      borderRadius: "20px",
                      fontWeight: "bold",
                      padding: "8px 15px",
                      backgroundColor: "#34495E",
                      color: "white",
                    }}
                  >
                    Search
                  </button>
                </form>
              </li>
            </ul>
          </div>

          {/* Right-side Icons */}
          <div className="d-flex align-items-center">
            <Link
              to="viewAddtocart"
              className="me-4"
              style={{ color: "#2C3E50", fontSize: "20px", transition: "0.3s" }}
              onMouseOver={(e) => (e.target.style.color = "#5D6D7E")}
              onMouseOut={(e) => (e.target.style.color = "#2C3E50")}
            >
              <i className="bi bi-cart3"></i>
            </Link>
            {isLoggedIn ? (
              <button className="btn btn-danger" onClick={handleLogout}>
                Logout
              </button>
            ) : (
              <Link to="/SignUp" style={{ fontSize: "20px" }}>
                <i className="bi bi-person-circle"></i>
              </Link>
            )}
          </div>
        </div>
      </nav>
      <Outlet />
    </>
  );
};

export default Navbar;
